import React from 'react';
import Bheem from './components/Bheem';
import Counter from './components/Counter';

function App() {
  // Move the useState hook inside the App component body
  // const [initalState, setState] = React.useState(0);

  function Increment() {
    setState((oldValue) => {
      return oldValue + 1;
    });
  }

  function Decrement() {
    setState((oldValue) => {
      return oldValue - 1;
    });
  }

  return (
    <div>
      <Bheem />
      <Counter incre={Increment} decre={Decrement} />
    </div>
  );
}

export default App;
